import * as React from 'react';
import MediaCard from '../MediaCard';
import classes from "./NftStaking.module.css";

function NftStaking(props) {
    return (
        <div className={classes.container}>
            <MediaCard />
            <MediaCard />
        </div>
    );
}


export default NftStaking;
